control.onControlLoad:
//鼠标点击行激活处理
g5.linkId = null;
g5.tableClick = function(sender) {
    var c, x, y;
    for (y = 0; y < g5.pageSize; y++) {
        for (x = 0; x < 7; x++) {
            c = ee.getTableCell(ee.getControl("tablebody2"), x, y);
            c.style.backgroundColor = "";    
        }
    }
    for (x = 0; x < 7; x++) {
        c = ee.getTableCell(ee.getControl("tablebody2"), x, sender.rowIndex);
        c.style.backgroundColor = "#E0EEFF";
    }
    if (eb.isEmpty(g5.dataset1)) {
        g5.linkId = null;
        return;
    }
    g5.linkId = parseInt(g5.dataset1.getData(0, sender.rowIndex));
    g5.linkName = g5.dataset1.getData(2, sender.rowIndex);
    g5.linkUrl = g5.dataset1.getData(5, sender.rowIndex);
    g5.linkNote = g5.dataset1.getData(6, sender.rowIndex);
    g5.pageTitle = g5.dataset1.getData(7, sender.rowIndex);
    g5.pageCompany = g5.dataset1.getData(8, sender.rowIndex);
    g5.pageTelA = g5.dataset1.getData(9, sender.rowIndex);
    g5.pageTelB  = g5.dataset1.getData(10, sender.rowIndex);
}


//分页处理
g5.pageSize = 15;
g5.pageCurrent = 1;
g5.pageCount = 1;
g5.pageJump = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount) {
        pageNumber = g5.pageCount;
    }
    if (g5.pageCurrent != pageNumber) {
        g5.pageCurrent = pageNumber;
        if (g5.pageCurrent > 0) {
            query();
        }
    }
}

query();

control.onClick:
ee.setEditText(ee.getControl("edit2"), "");
ee.setEditText(ee.getControl("edit4"), "");
ee.setEditText(ee.getControl("edit5"), "");
ee.setEditText(ee.getControl("edit1"), "");

g5.operation = "new";
ee.showAni(ee.getControl("panel1"));

if (eb.isEmpty(g5.linkId) || isNaN(g5.linkId)) {
    alert("请选择有效的记录进行编辑");
    return;
}
g5.newLinkName = prompt("请输入新的推广链接名称：", g5.linkName);
if (g5.newLinkName == null) return;
if (g5.newLinkName == g5.linkName) return;
modifyName();

if (eb.isEmpty(g5.linkId) || isNaN(g5.linkId)) {
    alert("请选择有效的记录进行操作");
    return;
}
if (!confirm("删除操作将导致不可返回的后果，如需恢复数据只有联系网管，您是否继续这个危险的操作？")) {
    return;
}
del();

if (eb.isEmpty(g5.linkId) || isNaN(g5.linkId)) {
    alert("请选择有效的记录进行编辑");
    return;
}
g5.newLinkUrl = prompt("请输入新的推广链接URL：", g5.linkUrl);
if (g5.newLinkUrl == null) return;
if (g5.newLinkUrl == g5.linkUrl) return;
modifyUrl();

if (eb.isEmpty(g5.linkId) || isNaN(g5.linkId)) {
    alert("请选择有效的记录进行编辑");
    return;
}
g5.newLinkNote = prompt("请输入新的推广链接备注：", g5.linkNote);
if (g5.newLinkNote == null) return;
if (g5.newLinkNote == g5.linkNote) return;
modifyNote();

if (eb.isEmpty(g5.linkId) || isNaN(g5.linkId)) {
    alert("请选择有效的记录进行编辑");
    return;
}

ee.setEditText(ee.getControl("edit7"), g5.pageTitle);
ee.setEditText(ee.getControl("edit6"), g5.pageCompany);
ee.setEditText(ee.getControl("edit8"), g5.pageTelA);
ee.setEditText(ee.getControl("edit9"), g5.pageTelB);

ee.showAni(ee.getControl("panel10"));

control.onUpdate:
if (text == "IDL") {
    ee.setText(sender, "<font color = '#d03030'>销售</font>");
} else if (text == "OFL") {
    ee.setText(sender, "<font color = '#30a030'>下架</font>");
} else if (text == "DEL") {
    ee.setText(sender, "删除");
} else {
    ee.setText(sender, text);
}

taskSetItem.script2:
var token = eio.readString8();
var searchText = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

//获取记录数量
var condition = "";
if (searchText != "") {
    condition +=
        " and (" +
        "(link.name like '%" + db.encode(searchText) + "%') or " +
        "(link.url like '%" + db.encode(searchText) + "%') or " +
        "(product.displayName like '%" + db.encode(searchText) + "%') or " +
        "(link.note like '%" + db.encode(searchText) + "%')) ";
}

sql =
    "SELECT count(*) as c " +
    "FROM dbo.product INNER JOIN " +
    "      dbo.link ON dbo.product.id = dbo.link.productId " +
    "WHERE (dbo.product.companyId = " + companyId + ") and (dbo.link.status <> 'DEL') " + condition;
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT dbo.link.id, dbo.link.regDatetime, dbo.link.name, " + 
    "      dbo.product.displayName, dbo.product.id AS productId, dbo.link.url, " + 
    "      dbo.link.note, dbo.link.pageTitle, dbo.link.pageCompany, dbo.link.pageTelA, dbo.link.pageTelB " +
    "FROM dbo.product INNER JOIN " +
    "      dbo.link ON dbo.product.id = dbo.link.productId " +
    "WHERE (dbo.product.companyId = " + companyId + ") and (dbo.link.status <> 'DEL') " + condition +
    "ORDER BY dbo.product.regDatetime DESC ";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"id,regDatetime,name,displayName,productId,url,note,pageTitle,pageCompany,pageTelA,pageTelB", pageSize*(pageCurrent-1), pageSize);

